//
// Arguments    : double b[7]
//                double a[7]
//                const double x[536]
//                const double zi[6]
//                double y[536]
// Return Type  : void
//
static void filter(double b[7], double a[7], const double x[536], const double
                   zi[6], double y[536])
{
  double a1;
  int k;
  int naxpy;
  int j;
  a1 = a[0];
  if ((!rtIsInf(a[0])) && (!rtIsNaN(a[0])) && (!(a[0] == 0.0)) && (a[0] != 1.0))
  {
    for (k = 0; k < 7; k++) {
      b[k] /= a1;
    }

    for (k = 0; k < 6; k++) {
      a[k + 1] /= a1;
    }

    a[0] = 1.0;
  }

  for (k = 0; k < 6; k++) {
    y[k] = zi[k];
  }

  memset(&y[6], 0, 530U * sizeof(double));
  for (k = 0; k < 536; k++) {
    naxpy = 536 - k;
    if (!(naxpy < 7)) {
      naxpy = 7;
    }

    for (j = 0; j + 1 <= naxpy; j++) {
      y[k + j] += x[k] * b[j];
    }

    naxpy = 535 - k;
    if (!(naxpy < 6)) {
      naxpy = 6;
    }

    a1 = -y[k];
    for (j = 1; j <= naxpy; j++) {
      y[k + j] += a1 * a[j];
    }
  }
}

//
// Arguments    : double x[536]
// Return Type  : void
//
static void flipud(double x[536])
{
  int i;
  double xtmp;
  for (i = 0; i < 268; i++) {
    xtmp = x[i];
    x[i] = x[535 - i];
    x[535 - i] = xtmp;
  }
}

