  memcpy(&b_y[0], &y[0], 536U * sizeof(double));
  filter(dv1, dv3, b_y, a, y);
  flipud(y);
  for (i = 0; i < 7; i++) {
    dv1[i] = dv2[i];
    dv3[i] = dv4[i];
  }

  for (i = 0; i < 6; i++) {
    a[i] = b_a[i] * y[0];
  }

  memcpy(&b_y[0], &y[0], 536U * sizeof(double));
  filter(dv1, dv3, b_y, a, y);
  flipud(y);
  memcpy(&Y[0], &y[18], 500U * sizeof(double));
